To find the smallest value of $x$ such that $|5x - 1| = |3x + 2|$, we need to consider two cases: one where the expressions inside the absolute value signs are positive, and the other where they are negative.  

Case 1: $5x - 1 = 3x + 2$
\begin{align*}
5x - 1 &= 3x + 2 \\
2x &= 3 \\
x &= \frac{3}{2} 
\end{align*}

Case 2: $5x - 1 = -(3x + 2)$
\begin{align*}
5x - 1 &= -3x - 2 \\
8x &= -1 \\
x &= -\frac{1}{8}
\end{align*}

So the smallest value of $x$ that satisfies $|5x - 1| = |3x + 2|$ is $\boxed{-\frac{1}{8}}$.

