Let $T$ be the weight of a treek, $S$ be the weight of a squig, and $G$ be the weight of a goolee. 

From the given information, we have:
\begin{align*}
10T &= 3S + G \\
2T + G &= S
\end{align*}

Now, we want to find the number of treeks that equal the weight of one squig, so we need to find $n$ such that $nT = S$.

We can start by solving the given equations for $T$ and $G$ in terms of $S$:
\begin{align*}
T &= \frac{3S+G}{10} \\
G &= S - 2T
\end{align*}

Substituting the expressions for $T$ and $G$ into the second equation, we get:
\begin{align*}
S - 2\left(\frac{3S+G}{10}\right) &= S - 2\left(\frac{3S + S - 2T}{10}\right) \\
S - \frac{6S + 2S -4T}{10} &= S - \frac{8S - 4T}{10} &= S - \frac{8T}{10} &= 0 \\
\end{align*}

Therefore, $8T = 10S \implies T = \frac{10S}{8} = \frac{5S}{4}$.

Hence, the weight of $\boxed{\frac{5}{4}}$ treeks equals the weight of one squig.

