To find the value of $g(3)$, we first need to find the value of $f^{-1}(x)$.

Let $y = f(x) = \frac{x+5}{3}$, we need to find $f^{-1}(x)$ in terms of $x$.
\begin{align*}
y &= \frac{x+5}{3} \\
3y &= x + 5 \\
x &= 3y - 5 \\
f^{-1}(x) &= 3x - 5
\end{align*}

Now, we can substitute $f^{-1}(x) = 3x - 5$ into the function $g(x)$.
\begin{align*}
g(x) &= \frac{1}{f^{-1}(x) + 1} \\
&= \frac{1}{3x - 5 + 1} \\
&= \frac{1}{3x - 4}
\end{align*}

Now, we need to find $g(3)$.
\begin{align*}
g(3) &= \frac{1}{3(3) - 4} \\
&= \frac{1}{9 - 4} \\
&= \frac{1}{5} \\
\end{align*}

Therefore, the value of $g(3)$ is $\boxed{\frac{1}{5}}$.

