\begin{align*}
3n + m &= 14 \\
3n + (1-n) &= 14 \\
3n + 1 - n &= 14 \\
2n + 1 &= 14 \\
2n &= 13 \\
n &= \frac{13}{2}
\end{align*}
Now we can find the value of $m$:
\begin{align*}
