Let's denote the common difference of the first arithmetic sequence as $d_1$ and the common difference of the second arithmetic sequence as $d_2$. 

For the first sequence, we have:
\begin{align*}
a_1 &= 0\\
a_2 &= a_1 + d_1 = 0 + d_1 = d_1\\
a_3 &= a_2 + d_1 + d_2 = d_1 + d_1 + d_2 = 2d_1 + d_2\\
a_4 &= a_3 + d_1 + d_2 = 2d_1 + d_2 + d_1 + d_2 = 3d_1 + 2d_2\\
a_5 &= a_4 + d_1 + d_2 = 3d_1 + 2d_2 + d_1 + d_2 = 4d_1 + 3d_2
\end{align*}

For the second sequence, we know the fifth term is $3$, therefore:
\begin{align*}
a_5^{(2)} &= 3
\end{align*}

We also know that the first term of the second sequence is the same as the common difference of the first sequence, which is $d_1$.  So, $a_1^{(2)} = d_1$. We can now find the fifth term of the first sequence by replacing $a_5^{(2)}$ with $3$ and $a_1^{(2)}$ with $d_1$ in the expression for $a_5$:
\begin{align*}
4d_1 + 3d_2 &= 3\\
4d_1 &= 3 - 3d_2\\
d_1 &= \frac{3 - 3d_2}{4}
\end{align*}

We are now looking for $a_5$:
\begin{align*}
a_5 &= 4d_1 + 3d_2\\
a_5 &= 4\left(\frac{3 - 3d_2}{4}\right) + 3d_2\\
a_5 &= 3 - 3d_2 + 3d_2\\
a_5 &= 3
\end{align*}

Therefore, the fifth term of the first sequence is $\boxed{3}$.

