c + h &= 10 \quad \text{(total number of heads)}
\end{align*}

Now we can solve this system of equations by substitution or elimination. We'll use substitution here.

From the second equation, we can find that $c = 10 - h$. Substituting this into the first equation:

\begin{align*}
