To solve for $y$, we can start by squaring both sides of the equation:

\begin{align*}
\left(\frac{\sqrt{6y+2}}{\sqrt{2y}}\right)^2 &= \left(\frac{5}{2}\right)^2 \\
\frac{6y+2}{2y} &= \frac{25}{4}
\end{align*}

Now, we can cross multiply to get rid of the fractions:

\begin{align*}
4(6y+2) &= 25(2y) \\
24y + 8 &= 50y
\end{align*}

Solving for $y$, we get:

\begin{align*}
50y - 24y &= 8 \\
26y &= 8 \\
y &= \frac{8}{26} \\
y &= \frac{4}{13}
\end{align*}

Therefore, the solution for $y$ is $\boxed{\frac{4}{13}}$.

