solution:
We see that \begin{align*}
2^{3^2} &= 2^{\left(3^2\right)} \\
&= 2^9 \\
&= \boxed{512}.
\end{align*}

Cancel some factors of 2 before subtracting: \begin{align*}
\frac{2^{10}-2^8}{2^7-2^6}&=\frac{2^8(2^{2}-1)}{2^6(2^1-1)} \\
&=2^2\left(\frac{3}{1}\right) \\
&=\boxed{12}.
\end{align*}

