Let the roots of the quadratic equation $ax^2 + 5x - 3 = 0$ be $r$ and $s$. 

By Vieta's formulas, we know that the sum of the roots is $r + s = -\frac{5}{a}$ and the product of the roots is $rs = -\frac{3}{a}$.

The absolute value of the difference of the two roots is $|r-s|$, which means $|r-s| = |(r+s)-2r| = |-\frac{5}{a}-2r| = \frac{\sqrt{61}}{3}$.

We can now substitute $rs = -\frac{3}{a}$ and $r + s = -\frac{5}{a}$ to simplify the expression:

\begin{align*}
\left|-\frac{5}{a} - 2r\right| &= \frac{\sqrt{61}}{3} \\
\left|\frac{5}{a} + 2s\right| &= \frac{\sqrt{61}}{3} \\
\frac{5}{a} + 2s &= \pm \frac{\sqrt{61}}{3} \\
2s &= -\frac{5}{a} \pm \frac{\sqrt{61}}{3}
\end{align*}

Since $a$ is positive and we were given the condition that $\left|r-s\right| = \frac{\sqrt{61}}{3}$, the expression $\left|-\frac{5}{a} - 2r\right|$ is equivalent to $\frac{5}{a} + 2r = \frac{\sqrt{61}}{3}$.

Substitute $\frac{5}{a} = \frac{\sqrt{61}}{3} - 2s$ into the equation:

\begin{align*}
\frac{\sqrt{61}}{3} - 2s + 2r &= \frac{\sqrt{61}}{3} \\
2r &= 2s \\
r &= s
\end{align*}

This implies that the roots $r$ and $s$ are equal. Substitute this back into $r+s=-\frac{5}{a}$:

\begin{align*}
2r &= -\frac{5}{a} \\
2r &= -\frac{5}{a} \\
r &= -\frac{5}{2a}
\end{align*}

We also know that $rs = -\frac{3}{a}$. Substitute the value of $r = -\frac{5}{2a}$:

\begin{align*}
-r^2 &= -\frac{3}{a} \\
\left(-\frac{5}{2a}\right)^2 &= \frac{3}{a} \\
\frac{25}{4a^2} &= \frac{3}{a} \\
25a &= 12a^2 \\
4a^2 - 25a &= 0 \\
a(4a - 25) &= 0
\end{align*}

Therefore, $a=0$ is not valid because it should be positive. Solving $4a - 25 = 0$, we get $a = \boxed{\frac{25}{4}}$.

